import targets from '../../targets.json';
const logReducer = (state = false,action) => {
    console.log(action);
    switch(action.type){
        case 'signin':
            fetch(targets.signin,{
                method:'POST',
                headers:{"Content-Type":"application/json"},
                body:JSON.stringify(action.payload)
            })
            .then(response=>{
                if(response.status===200)
                     return true;
                else
                    return false;
                    
            })
            .catch(err=>{
                console.log(err);
                 return false;
                
            })
          break;
        case "signout":
                fetch(targets.signout,{
                    method:'POST',
                    headers:{"Content-Type":"application/json"},
                    body:JSON.stringify(action.payload)
                })
                .then(response=>{
                    if(response.status===200)
                         return false;
                    else
                        return true;
                })
                .catch(err=>{
                    console.log(err);
                      return true;
                })
            default:
                    return state;
    }
}
export default logReducer;
